import styles from "./AppHeader.module.css";
// import { data } from "../../utils/data";
import { BurgerIcon } from "@ya.praktikum/react-developer-burger-ui-components";
import { ListIcon } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/icons";
import { Logo } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/logo";
import { ProfileIcon } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/icons";

function AppHeader() {
  return (
    <header className={styles.AppHeader}>
      <div style={{ color: "white" }} className="pl-5 pb-4 pt-4 pr-2">
        <BurgerIcon type="primary" />
      </div>
      <div style={{ color: "white" }} className="pl-2 pb-4 pt-4 pr-5">
        <p className="text text_type_main-default">Конструктор</p>
      </div>
      <div style={{ color: "white" }} className="pl-5 pb-4 pt-4 pr-2">
        <ListIcon type="secondary" />
      </div>
      <div style={{ color: "white" }} className="pl-2 pb-4 pt-4 pr-5">
        <p className="text text_type_main-default">Лента заказов</p>
      </div>
      <div style={{ color: "white" }} className=" pb-4 pt-4">
      <Logo />
      </div>
      <div style={{ color: "white" }} className="pl-5 pb-4 pt-4 pr-2">
        <ProfileIcon type="secondary" />
      </div>
      <div style={{ color: "white" }} className="pl-2 pb-4 pt-4 pr-">
        <p className="text text_type_main-default">Личный кабинет</p>
      </div>
    </header>
  );
}

export default AppHeader;
